import './index.css'

const Hobbies = ({title, contents}) =>{

    return(
        <div className="square hobbies">
            <h1>{title}</h1>
            <ul>
                <li>20 años{contents[0]}</li>
                <li>México {contents[1]}</li>
                <li>Estado de México {contents[2]}</li>
                <li>Estudiante de Ciencias de la computación {contents[3]}</li>
            </ul>
        </div>
    )
}

export default Hobbies;
